$(document).ready(function(){var e=$("#boardgamelist"),a=$("#boardgamepic"),i=$("#boardgametime");$.ajax({type:"get",url:"https://bgg-json.azurewebsites.net/collection/jayellexo",dataType:"json",success:function(n){$(n).each(function(n,t){a.append('<li><img src="'+t.thumbnail+'"></li>'),e.append("<li>"+t.name+"</li>"),i.append("<li>"+t.playingTime+"</li>")})}})});